(9, 3, 2, 5, 5, 5, 1, 1, 1, 1, 1, 2, 1, 1, 1, 1, 2, 1, 1, 1, 1, 5, 3, 5, 5, 5, 5, 5, 5, 1, 2, 4, 4, 5, 3, 4, 2, 4, 3, 'JEFE DE ARIA', 'nunca', 'NADA'),
(10, 3, 5, 5, 5, 4, 5, 2, 5, 4, 2, 2, 2, 3, 5, 5, 5, 4, 5, 5, 5, 5, 4, 4, 5, 4, 1, 4, 5, 4, 4, 5, 1, 3, 5, 4, 3, 4, 1, 'Eduardo Martinez', 'Eduardo Martinez', 'Sugerencia. La diciplina laboral necesita retroalimentarse ya que en mi punto de vista eso es un caos en planta.'),
(11, 1, 5, 5, 5, 4, 4, 4, 5, 4, 3, 3, 5, 5, 2, 3, 2, 2, 2, 5, 2, 3, 3, 1, 4, 3, 3, 3, 3, 3, 4, 2, 2, 3, 3, 4, 3, 3, 1, 'octavio', 'vero', 'que exita el respeto tanto de jefes de area como personal ya que este es un motivo por el cual la gente renuncia'),
(12, 4, 5, 3, 4, 3, 5, 3, 3, 3, 1, 3, 3, 4, 5, 4, 4, 5, 4, 5, 5, 3, 3, 3, 4, 4, 3, 4, 5, 3, 4, 5, 3, 4, 3, 3, 5, 4, 5, 'Eduardo Martinez', 'Eduardo Martinez', 'Estar mas al pendiente en el estado laboral del personal '),
